import React from 'react';
import '../App.css'
import {Toolbar,Drawer,Box,CssBaseline} from '@mui/material';



const drawerWidth = 240;

export const Sidebar=()=>{
  return (
    <div className='list'>
    <Box sx={{
          display: 'flex',
          flexDirection: 'column',
          height: '100%'
        }}>
      {/* <CssBaseline /> */}

      <Drawer

        sx={{

          width: drawerWidth,
          flexShrink: 0,
          '& .MuiDrawer-paper': {
            width: drawerWidth,
            boxSizing: 'border-box',
            backgroundColor:"#234872",

          },
        }}
        variant="permanent"
        anchor="left"
      >
        <Toolbar />


        <ul className='list'>
         <a href='/'> <li>Dashboard</li></a>
         <a href='/'><li>Users</li></a> 
         <a href='/'><li>Products</li></a>
         <a href='/'><li>Register</li></a> 
         <a href='/'><li>Typography</li></a>
         <a href='/'><li>Account</li></a>
         <a href='/'><li>Settings</li></a>
        </ul>

      </Drawer>

    </Box>
    </div>
  );
}
